import React from 'react';

class NavBar extends React.Component{

    render(){
        return(
            <table>
                <tr>
                    <td><a>Logo</a></td>
                    <td><a>+</a></td>
                    <td><a>User</a></td>
                    <td><a>Log</a></td>
                </tr>
            </table>
        );
    }

}

export default NavBar;
